import { Switch } from "react-router-dom";
import "./App.css";
import Table from "./components/table";

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path = ''>
          <Table/>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
